import React from "react";
import Slider from "react-slick";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import "./StNewsCarousel.css";

const NewsCarousel = () => {
    const settings = {
        dots: true,
        infinite: true,
        speed: 500,
        slidesToShow: 1,
        slidesToScroll: 1,
    };

    return (
        <div className="news-carousel">
            <Slider {...settings}>
                <div><img src="https://via.placeholder.com/1200x400" alt="News 1" /></div>
                <div><img src="https://via.placeholder.com/1200x400" alt="News 2" /></div>
                <div><img src="https://via.placeholder.com/1200x400" alt="News 3" /></div>
            </Slider>
        </div>
    );
};

export default NewsCarousel;
